request = require('request-json');
var simpleREquest = require('request');
var config = require('../configFactory').getConfig();
process.chdir(__dirname);

var chai = require("chai");
var expect = chai.expect;
var assert = chai.assert;


var client = request.createClient('http://localhost:9000/');

function sendFileAndCheckContentType(cloudProvider, bucket, fileName, expectedContentType, done, credentials) {
    var data = {
        file: "V2UgbG92ZSB5b3JhbQ==",
        cloudProvider: cloudProvider,
        storage:{
            fileName: fileName,
            bucket: bucket,
            dir: "upload"
        },
        credentials: credentials
    };
    client.post('uploadFile', data, function (err, res, body) {
        assert.isTrue(res.statusCode === 200);

        simpleREquest
            .get(body.link)
            .on('response', function (response) {
                assert.isTrue(response.headers['content-type'] === expectedContentType);

                done();
            })
    });
}
describe('upload files to AWS Default Backand credentials', function(){
    it('can send full file', function(done){
        var data = {
            file: "",
            cloudProvider: "AWS",
            storage:{
                fileType: "image/jpg",
                fileName: "clock.jpg",
                bucket: "hosting.backand.net",
                dir: "upload"
            }
        };
        client.post('uploadFile', data, function(err, res, body) {
            assert.isTrue(res.statusCode === 200);

            assert.isTrue(body.link === 'http://hosting.backand.net/upload/clock.jpg');
            done();
        });
    })

    it('server can identify mp3 mime type', function(done){
        var fileName = "clock.mp3";
        var expectedContentType = "audio/mpeg";
        var bucket = "hosting.backand.net";
        var cloudProvider = "AWS";
        sendFileAndCheckContentType(cloudProvider, bucket, fileName, expectedContentType, done);
    })

    it('server can identify text mime type', function(done){
        var fileName = "clock.txt";
        var expectedContentType = "text/plain";
        var bucket = "hosting.backand.net";
        var cloudProvider = "AWS";
        sendFileAndCheckContentType(cloudProvider, bucket, fileName, expectedContentType, done);    })

    it('server can identify video mime type', function(done){
        var fileName = "clock.mp4";
        var expectedContentType = "video/mp4";
        var bucket = "hosting.backand.net";
        var cloudProvider = "AWS";
        sendFileAndCheckContentType(cloudProvider, bucket, fileName, expectedContentType, done);    })

    it('server can identify pdf mime type', function(done){
        var fileName = "clock.pdf";
        var expectedContentType = "application/pdf";
        var bucket = "hosting.backand.net";
        var cloudProvider = "AWS";
        sendFileAndCheckContentType(cloudProvider, bucket, fileName, expectedContentType, done);    })

    it('server can identify image mime type', function(done){
        var fileName = "clock.png";
        var expectedContentType = "image/png";
        var bucket = "hosting.backand.net";
        var cloudProvider = "AWS";
        sendFileAndCheckContentType(cloudProvider, bucket, fileName, expectedContentType, done);    })

    it('server can identify image json type', function(done){
        var fileName = "clock.json";
        var expectedContentType = "application/json";
        var bucket = "hosting.backand.net";
        var cloudProvider = "AWS";
        sendFileAndCheckContentType(cloudProvider, bucket, fileName, expectedContentType, done);    })

    it('server can handle unknown mime type', function(done){
        var fileName = "clock.backand";
        var expectedContentType = "text/plain";
        var bucket = "hosting.backand.net";
        var cloudProvider = "AWS";
        sendFileAndCheckContentType(cloudProvider, bucket, fileName, expectedContentType, done);    })
})
